import React from 'react';

import { makeStyles, useTheme } from '@material-ui/core/styles';
import { Grid } from '@material-ui/core';

import Nav from '../../components/Navigation/Nav';
import Jumbotron from '../../components/Home/Jumbotron';
import Body from '../../components/Home/Main/Body';

const MountainsImg = require('../../components/Home/imgs/SVG/FrontPage.svg');


function Home() {

    return (
        <Grid container >
            <Grid xs={12}>
                <Nav />
            </Grid>
            <Grid xs={12}>
                {/* <Jumbotron /> */}
            </Grid>
            <div style={{backgroundImage: `url(${MountainsImg})`, backgroundSize: '100% 40vh'}}>
                <Grid xs={2}></Grid>
                <Grid xs={8}>
                    <Body />
                </Grid>
            </div>
            <Grid xs={2}></Grid>
        </Grid>
    );
}

export default Home;
